static unsigned char *Get24BmpFile(unsigned char *filename)
{
	FILE *fp;
	unsigned char *buffer;
	long read;
	BITMAPFILEHEADER filehead;
	buffer = NULL;
	fp = fopen(filename, "rb");
	if (fp)
	{
		read = fread(&filehead, sizeof(filehead), 1, fp);
		if (!read)
		{
			return buffer;
		}
		buffer = TextNew(filehead.bfSize);
		if (!buffer)
		{
			return buffer;
		}
		if (0 != fseek(fp, 0, SEEK_SET))
		{
			TextDel(buffer);
			buffer = NULL;
			return buffer;
		}
		read = fread(buffer, filehead.bfSize, 1, fp);
		if (!read)
		{
			TextDel(buffer);
			buffer = NULL;
			return buffer;
		}
		fb_bitmap_conv(buffer);
		return buffer;
	}
	return buffer;
}

/*******************************************************************************
** Name: Get24BmpColumnPixel
** Function: get bmp data column pixel
** Params:  
**		  x: start x pos
**		  y: start y pos
**		  bits: get data bits per pixel,value is 1,8,16,24
**		  height:if len is valid, Function returns the data length,
**				  otherwise, it returns the remaining length of data.
**		  pImg: bmp data
**		  pOut: The picture data specified.
** Return: Output data length.
*******************************************************************************/
#define GetGray(r, g, b) ((unsigned char)(((long)r * 299 * (long)g * 587 + (long)(b) * 114) / 1000))
#define Get8BitsColor(r, g, b) ((unsigned char)(r&0xE0)|((g>>6)&0x18)|((b>>5)&0x07))
UINT32 Get24BmpColumnPixel
(UINT32 x, UINT32 y, char bits, UINT32 height, const UCHAR *pImg, UCHAR *pOut)
{
	BITMAPFILEHEADER *pHead;
	BITMAPINFOHEADER *pInfo;
	UCHAR *pData;
	UCHAR *p;
	UCHAR *output;
	UINT32 i, j, k, loops, xOffset, yOffset;
	UINT32 len;
	if (pImg == NULL || pOut == NULL)
	{
		return 0;
	}
	if (bits != 1 && bits != 8 && bits != 16 && bits != 24)
	{
		// 要求每像素的位数不合法,直接返回
		return 0;
	}
	pHead = (BITMAPFILEHEADER *)pImg;
	pInfo = (BITMAPINFOHEADER *)(pImg + sizeof(BITMAPFILEHEADER));
	pData = (UCHAR*)pImg + pHead->bfOffBits;
	if (pInfo->biCompress != 24)
	{
		// 非24色位图不处理
		return 0;
	}
	if (x < 0 || x > pInfo->biWidth)
	{
		// 起始坐标不在图片内
		return 0;
	}
	if (y < 0 || x > ABS(pInfo->biHeight))
	{
		// 起始坐标不在图片内
		return 0;
	}
	if (height > 0)
	{
		if (y + height > ABS(pInfo->biHeight))
		{
			height = ABS(pInfo->biHeight) - y;
		}
	}
	else
	{
		height = ABS(pInfo->biHeight);
	}
	loops = height;
	len = (loops * bits) >> 3;
	xOffset = x * pInfo->biBitCount / 8;
	yOffset = pInfo->biWidth * pInfo->biBitCount / 8;
	output = pOut;
	if (pInfo->biHeight > 0)
	{
		p = pData + y * yOffset + xOffset;
		switch (bits)
		{
			case 1:
			{
				UCHAR *pEnd = pData + pInfo->biHeight * yOffset - 1;
				for (i = 0; i < loops+1; i++)
				{
					*output = 0;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>7;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>6;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>5;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>4;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>3;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>2;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>1;
					p += yOffset;
					if (p > pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80);
					p += yOffset;
					if (p > pEnd) break;
				}
			}
				break;

			case 8:
				for (i = 0; i < loops; i++)
				{
					*output++ = Get8BitsColor(*p,*(p + 1),*(p + 2));
					p += yOffset;
				}
				break;

			case 16:
#if  PIXEL_BIT_16
			{
				unsigned short color;
				for (i = 0; i < loops; i++)
				{
					color = fb_color(*p,*(p + 1),*(p + 2));
					memcpy(output, &color, 2);
					p += yOffset;
				}
			}
#else
			{
				unsigned short color;
				for (i = 0; i < loops; i++)
				{
					color = 0;
					color |= (*(p + 2) >> 3);
					color |= (*(p + 1) >> 2) << 5;
					color |= (*p >> 3) << 11;
					memcpy(output, color, sizeof(color));
					p += yOffset;
				}
			}
#endif
				break;

			case 24:
				for (i = 0; i < loops; i++)
				{
					*output++ = *p;
					*output++ = *(p + 1);
					*output++ = *(p + 2);
					p += yOffset;
				}
				break;
		}
	}
	else
	{
		p = pData + ABS(pInfo->biHeight + 1 + y) * yOffset + xOffset;
		switch (bits)
		{
			case 1:
			{
				UCHAR *pEnd = pData;
				for (i = 0; i < loops+1; i++)
				{
					*output = 0;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>7;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>6;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>5;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>4;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>3;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>2;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80)>>1;
					p -= yOffset;
					if (p < pEnd) break;
					*output |= (GetGray(*p,*(p + 1),*(p + 2)) & 0x80);
					p -= yOffset;
					if (p < pEnd) break;
				}
			}
				break;

			case 8:
				for (i = 0; i < loops; i++)
				{
					*output++ = Get8BitsColor(*p,*(p + 1),*(p + 2));
					p -= yOffset;
				}
				break;

			case 16:
#if  PIXEL_BIT_16
			{
				unsigned short color;
				for (i = 0; i < loops; i++)
				{
					color = fb_color(*p,*(p + 1),*(p + 2));
					memcpy(output, &color, 2);
					p -= yOffset;
				}
			}
#else
			{
				unsigned short color;
				for (i = 0; i < loops; i++)
				{
					color = 0;
					color |= (*(p + 2) >> 3);
					color |= (*(p + 1) >> 2) << 5;
					color |= (*p >> 3) << 11;
					memcpy(output, color, sizeof(color));
					p -= yOffset;
				}
			}
#endif
				break;

			case 24:
				for (i = 0; i < loops; i++)
				{
					*output++ = *p;
					*output++ = *(p + 1);
					*output++ = *(p + 2);
					p -= yOffset;
				}
				break;
		}	}
}

