BOOL BmpCopy(UCHAR *dest, UCHAR *src)
{
	short *head;
	unsigned long  bfsize = ((BITMAPFILEHEADER *)src)->bfSize;
	head = (short*)src;
	if (*head != 0x4D42)	// 不是位图文件,不必复制,直接返回
		return FALSE;
	// 判断是否格式和大小是否一致
	if (memcmp(dest, src, sizeof(short)+sizeof(long)))
		return FALSE;
	memcpy(dest, src, bfsize);
	return TRUE;
}


/*******************************************************************************
* Function	: GetBmpPixelOffset
* Description : 获取位图中某一点在该文件的指针位置
* Input Para  : bmp:图片文件数据 x: y: 需要非负数坐标值,以图片左上角为原点
* Output Para : 
* Return Value: 成功返回指向该坐标的指针,失败返回null
*******************************************************************************/
UCHAR * GetBmpPixelOffset(UCHAR *bmp, INT32 x, INT32 y)
{
	UCHAR * ret = NULL;
	PBMPFILEHEAD pBmp;
	INT32 lineOffset;
	// 坐标小于0,直接返回
	if (x < 0 || y < 0)
		return ret;
	// 位图数据为空,直接返回
	if (bmp == NULL)
		return ret;
	pBmp = (BMPFILEHEAD*)bmp;
	// 不是图片,直接返回
	if (pBmp->bfType != 0x4D42)
		return ret;
	// y坐标不在图片内,直接返回
	if (ABS(pBmp->biHeight) < y + 1)
		return ret;
	// x坐标不在图片内,直接返回
	if (pBmp->biWidth < x + 1)
		return ret;

	lineOffset = ((pBmp->biWidth * pBmp->biBitCount + 7) >> 3);
	if (pBmp->biHeight > 0) // 图像是倒向的
	{
		ret = bmp + (pBmp->bfOffBits + (pBmp->biHeight - y - 1) * lineOffset);
	}
	else
	{
		ret = bmp + (pBmp->bfOffBits + y * lineOffset);
		
	}
	ret = ret + ((x * pBmp->biBitCount + 7) >> 3);
	return ret;
}

/*******************************************************************************
* Function	: ChangeBatteryBmp
* Description : 将源图片纵向像素刷到其余位置以实现动态电量图标
* Input Para  : percent:电量百分比 bmp:输出图片数据指针 src:源图片数据指针
* Output Para : bmp:处理好的图片数据会放到这里
* Return Value: 无
*******************************************************************************/
VOID ChangeBatteryBmp(CHAR percent, UCHAR *bmp, UCHAR *src)
{
	// 源图片中代表空和电量的纵(横?)向坐标(边缘)
	const INT32 EmptyPos = 19;
	const INT32 PowerPos = 3;
	PBMPFILEHEAD pBmp, pSrc;
	pBmp = (BMPFILEHEAD*)bmp;
	pSrc = (BMPFILEHEAD*)src;
	INT32 length = ABS(EmptyPos - PowerPos) + 1;
	INT32 emptyLen = (int)(length * 1.0 * (100 - percent) / 100 + 0.5);
	INT32 powerLen = (int)(length * 1.0 * percent / 100 + 0.5);
	INT32 direction = (EmptyPos > PowerPos) ? 1 : -1;
	INT32 power = PowerPos + direction * powerLen;
	INT32 pos;
	INT32 offset;
	UCHAR *ret;
	INT32 i;
	if (pBmp->bfSize == pSrc->bfSize)
	{
		if (pSrc->biBitCount != 24)
		{
			prinfo("Not A 24Bits Bmp File!!\r\n");
			return;
		}
		#if 0   // 电池图标直立
		UCHAR *pen;
		// 刷空电量像素
		pos = EmptyPos;
		pen = GetBmpPixelOffset(src, 0, pos);
		offset = (pSrc->biWidth * pSrc->biBitCount + 7) >> 3;
		while(pos != power)
		{
			pos -= direction;
			if (ret = GetBmpPixelOffset(bmp, 0, pos))
			{
				memcpy(ret, pen, offset);
			}
		}
		// 刷电量像素
		pos = PowerPos;
		while(pos != power)
		{
			pos += direction;
			if (ret = GetBmpPixelOffset(bmp, 0, pos))
			{
				memcpy(ret, pen, offset);
			}
		}
		#else   // 电池图标横置
		UCHAR PowerLine[24][3] = {0};
		UCHAR EmptyLine[24][3] = {0};
		if (ABS(pSrc->biHeight) > TABLESIZE(PowerLine))
		{
			prinfo("Not Enough Buffer Size!!\r\n");
			return;
		}
		for (i = 0; i < ABS(pSrc->biHeight); i++)
		{
			if (ret = GetBmpPixelOffset(src, EmptyPos, i))
			{
				EmptyLine[i][0] = *ret++;
				EmptyLine[i][1] = *ret++;
				EmptyLine[i][2] = *ret++;
			}
			if (ret = GetBmpPixelOffset(src, PowerPos, i))
			{
				PowerLine[i][0] = *ret++;
				PowerLine[i][1] = *ret++;
				PowerLine[i][2] = *ret++;
			}
		}
		// 刷空电量像素
		pos = EmptyPos;
		while(pos != power)
		{
			pos -= direction;
			for (i = 0; i < ABS(pSrc->biHeight); i++)
			{
				if (ret = GetBmpPixelOffset(bmp, pos, i))
				{
					*ret++ = EmptyLine[i][0];
					*ret++ = EmptyLine[i][1];
					*ret++ = EmptyLine[i][2];
				}
			}
		}
		// 刷电量像素
		pos = PowerPos;
		while(pos != power)
		{
			pos += direction;
			for (i = 0; i < ABS(pSrc->biHeight); i++)
			{
				if (ret = GetBmpPixelOffset(bmp, pos, i))
				{
					*ret++ = PowerLine[i][0];
					*ret++ = PowerLine[i][1];
					*ret++ = PowerLine[i][2];
				}
			}
		}
		#endif
	}
}

