/*******************************************************************************
* Function	: ChangeBatteryBmpEx
* Description : 为了提高效率,直接返回预处理过的图片数据
* Input Para  : percent:电量百分比
* Output Para : 
* Return Value: 返回处理好的图片数据指针
*******************************************************************************/
UCHAR *ChangeBatteryBmpEx(INT8 percent)
{
//	const INT32 EmptyPos = 19;
//	const INT32 PowerPos = 3;
	// 17 = 19 - 3 + 1;
	static UCHAR *bmp[2][17] = {NULL};
	INT32 ndx = 17 * percent / 100;
	if (percent > 100 || percent < 0)
		return NULL;
	if (ndx == 17)
		ndx = 16;//100%
	if (NULL == bmp[0][0])
	{
		BMPFILEHEAD *p = (BMPFILEHEAD*)batt_icon[0][2];
		int size = p->bfSize;
		UCHAR *buff;
		if (buff = (UCHAR *)malloc(size * 17 * 2))
		{
			int i;
			memset(buff, 0, (size * 17));
			for (i = 0; i < 17; i++)
			{
				bmp[0][i] = buff + size * i;
				memcpy(bmp[0][i], batt_icon[0][2], size);
				ChangeBatteryBmp(i * 100 / 17, bmp[0][i], batt_icon[0][2]);
			}
			for (i = 0; i < 17; i++)
			{
				bmp[1][i] = buff + size * (i + 17);
				memcpy(bmp[1][i], batt_icon[1][2], size);
				ChangeBatteryBmp(i * 100 / 17, bmp[1][i], batt_icon[1][2]);
			}
		}
	}
//	printf("%s::percent %d, bmp[MonitorConfig.nightModeOn][%d]%p\n",
//		__FUNCTION__, percent, ndx, bmp[MonitorConfig.nightModeOn][ndx]);
//	Put24Bitmap(HDC_SCREEN, 1, 1, 0, bmp[MonitorConfig.nightModeOn][ndx]);
	return bmp[MonitorConfig.nightModeOn][ndx];
}

